use anyhow::Result;
use std::fs::File;
use serde::Deserialize;
use matrixmultiply::sgemm;

#[derive(Deserialize)]
pub struct ScoreModel {
    pub up_proj: Vec<f32>,
    pub bias: Vec<f32>,
    pub down_proj: Vec<f32>,
    pub output_channels: usize,
    pub d_emb: usize,
    pub scale: f32
}

#[inline]
fn logistic(x: f32) -> f32 {
    1.0 / (1.0 + (-x).exp())
}

#[inline]
fn silu(x: f32) -> f32 {
    x * logistic(x)
}

impl ScoreModel {
    pub fn score_batch(&self, input: &[f32]) -> Vec<f32> {
        let batch_size = input.len() / self.d_emb;
        let hidden_size = self.up_proj.len() / self.d_emb;
        assert_eq!(batch_size * self.d_emb, input.len());
        assert_eq!(hidden_size * self.d_emb, self.up_proj.len());
        assert_eq!(hidden_size * self.output_channels, self.down_proj.len());

        let mut hidden_state = vec![0.0; batch_size * hidden_size];

        // HxD DxB -> HxB up_proj @ input.T
        unsafe {
            sgemm(
                hidden_size, self.d_emb, batch_size,
                1.0, self.up_proj.as_ptr(), self.d_emb as isize, 1,
                input.as_ptr(), 1, self.d_emb as isize,
                0.0, hidden_state.as_mut_ptr(), 1, hidden_size as isize
            );
        }

        // add bias
        // could also do it in the sgemm, but we have to do silu anyway
        for i in 0..batch_size {
            let hslice = &mut hidden_state[i * hidden_size..(i + 1) * hidden_size];
            for (hslice, bias) in hslice.iter_mut().zip(self.bias.iter()) {
                *hslice = silu(*hslice + *bias);
            }
        }

        let mut out = vec![0.0; batch_size * self.output_channels];

        // CxH HxB -> CxB down_proj @ hidden_state
        unsafe {
            sgemm(
                self.output_channels, hidden_size, batch_size,
                1.0, self.down_proj.as_ptr(), hidden_size as isize, 1,
                hidden_state.as_ptr(), 1, hidden_size as isize,
                0.0, out.as_mut_ptr(), 1, self.output_channels as isize
            );
        }

        for o in out.iter_mut() {
            *o /= self.scale;
        }

        out
    }

    pub fn load(path: &str) -> Result<Self> {
        let file = File::open(path)?;
        let score_model: ScoreModel = rmp_serde::from_read(file)?;
        Ok(score_model)
    }
}

